import React from 'react';

const Home = () => {
  return (
    <div>
      <h2>Home</h2>
      <h2>Bienvenido LISUAL a tu dashboard</h2>
      <iframe title="timelapse" width="100%" height="700" src= "//www.teleport.io/api/v2/player?feedid=fekiizlmvw6b&playmode=liveimageloop&imageplayspeed=1fps&playframeskipinterval=day&playframecount=600" frameBorder="0" allowFullScreen></iframe>
    </div>
  );
};

export default Home;
